class Node:    def __init__(self, data):        self.data_ = data        self.next_ = Noneclass LinkedList:    def __init__(self):        self.head = None        self.count = 0    def print_(self):        node = self.head        print('---------')        while node != None:            print('This is data: ',node.data_)            node = node.next_            print('THis is address:',node)            print('this is address: ', node.next_)    def insert(self, value):        node = Node(value)        if(self.head == None or self.count == 0):            self.head = Node(value)        elif(self.count == 1):            self.head.next_ = Node(value)            print(self.head.data_)            node = Node(value)            print(node.data_)            print('------->',node.next_)        else:                        node.next_ = Node(value)            print(node.next_)            node = Node(value)            print(node.data_)            print('------->',node.next_)        self.count = self.count + 1        self.print_()        linkedlist = LinkedList()linkedlist.insert(9)linkedlist.insert(91)linkedlist.insert(911)linkedlist.insert(19)linkedlist.insert(119)linkedlist.print_()